import ServiceCard from '../cmpontes';

const services = [
  {
    title: 'Modular Kitchen',
    description: 'Custom kitchen designs that blend style and functionality.',
    color: 'bg-blue-100',
    iconColor: 'text-blue-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><path d="M4 6h16M4 12h16M4 18h16" /></svg>
    ),
  },
  {
    title: 'False Ceiling',
    description: 'Elegant ceiling solutions for a modern look and feel.',
    color: 'bg-pink-100',
    iconColor: 'text-pink-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><circle cx="12" cy="12" r="10" /></svg>
    ),
  },
  {
    title: 'TV Units',
    description: 'Stylish TV units that enhance your living space.',
    color: 'bg-green-100',
    iconColor: 'text-green-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><rect x="4" y="4" width="16" height="16" rx="2" /></svg>
    ),
  },
  {
    title: 'Wardrobes',
    description: 'Spacious and stylish wardrobes tailored to your needs.',
    color: 'bg-yellow-100',
    iconColor: 'text-yellow-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><rect x="4" y="4" width="16" height="16" rx="2" /></svg>
    ),
  },
  {
    title: 'Office Interiors',
    description: 'Modern office designs for productive workspaces.',
    color: 'bg-purple-100',
    iconColor: 'text-purple-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><rect x="4" y="4" width="16" height="16" rx="2" /></svg>
    ),
  },
  {
    title: 'Bedroom Design',
    description: 'Relaxing and beautiful bedroom interiors.',
    color: 'bg-red-100',
    iconColor: 'text-red-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><rect x="4" y="4" width="16" height="16" rx="2" /></svg>
    ),
  },
];

function Services() {
  return (
    <div className="max-w-6xl mx-auto py-16 px-4">
      <h1 className="text-4xl font-bold mb-10 text-center">Our Services</h1>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {services.map((service, i) => (
          <ServiceCard key={i} {...service} />
        ))}
      </div>
    </div>
  );
}

export default Services;
